import React from "react";
import { Link } from "react-router-dom";
import "../styles/PropertyCard.css";

const PropertyCard = ({ property }) => {
    return (
        <Link to={`/properties/${property._id}`} className="property-card-link">
            <div className="property-card">
                <div className="property-image">
                    <div className="placeholder-image">Property Image</div>
                    <span className="status-badge">{property.status}</span>
                </div>

                <div className="property-card-content">
                    <h3>{property.title}</h3>
                    
                    <div className="property-type-location">
                        <span className="property-type">{property.propertyType}</span>
                        <span className="location">{property.location.city}, {property.location.state}</span>
                    </div>

                    <p className="description">{property.description.substring(0, 80)}...</p>

                    <div className="property-footer">
                        <div className="price">â‚¹ {property.price.toLocaleString()}</div>
                        <button className="view-btn">View Details</button>
                    </div>
                </div>
            </div>
        </Link>
    );
};

export default PropertyCard;
